	"mymedicalhelpline/view/HelpInfo.fragment.xml": "<core:FragmentDefinition\r\n\txmlns=\"sap.m\"\r\n\txmlns:core=\"sap.ui.core\"><Popover\r\n\t\tshowHeader=\"false\"\r\n\t\tcontentWidth=\"20rem\"\r\n\t\tcontentHeight=\"auto\"\r\n\t\tplacement=\"Bottom\"><Text wrapping=\"true\" class=\"sapUiSmallMargin\" text=\"You can search here for all the essential services in any city and get their contact details. Essential services include COVID-19 Testing Labs, Food, Grocery, Medicine Delivery options, Wellness centers, Emergency services, Donation camps, Helplines etc. List of available categories are enlisted in the below categories dropdown.\"/></Popover></core:FragmentDefinition>",
